import { FC } from 'react';
import { PageBackground } from '../common/common.styles';
import { NavBar } from '../NavBar/NavBar';
import { IntroText, RecipeGrid, RecipeContainer, RecipeTitle } from './HomePage.styles'
import NavBarBackgroundImage from '../../images/homeBanner.jpg'

const HomePage: FC<{}> = ({}) => {
    return (
        <PageBackground background_colour='#F2BE8C'>
            <NavBar image_src={NavBarBackgroundImage} border_colour= {'#89717B'}/>
            <IntroText> A collection of food, recipes and thoughts so that others can enjoy them the way that I have. </IntroText>
            <RecipeGrid>
                <RecipeContainer>
                    <RecipeTitle> Chicken tacos with 
                        capsicum, Guac and corn</RecipeTitle>
                </RecipeContainer>
                <RecipeContainer>
                    <RecipeTitle> </RecipeTitle>
                </RecipeContainer>
                <RecipeContainer>
                    <RecipeTitle> lemon tart</RecipeTitle>
                </RecipeContainer>
            </RecipeGrid>
        </PageBackground>
    );
};
export default HomePage;
